ort:{EN:"Invalid internal port",FR:"TODO",SPN:"Puerto interno invalido",DE:"Ungültiger interner Port",IT:"TODO",DA:"TODO",AR:"TODO",PT:"TODO",RO:"Port intern invalid",IND:"TODO"},applyGatewayChangesDescription:{EN:"The action you performed may cause devices to temporarily lose connectivity. If you changed the IP address of the gateway, you will have to change the IP address in your browser before accessing the configuration interface again.",FR:"Cette action peut temporairement déconnecter vos périphériques. Si vous avez modifié l'adresse IP de la passerelle, vous devrez modifier l'adresse IP dans votre navigateur avant d'accéder de nouveau au site web de configuration.",SPN:"La acción que ha realizado puede causar que dispositivos pierdan conectividad. Si ha cambiado la dirección IP de la puerta de entrada tendrá que cambiar la dirección IP en el navegador antes de acceder a la interfaz de configuración de nuevo.",DE:"Die von Ihnen ausgeführte Aktion kann dazu führen, dass die Geräte vorübergehend die Verbindung verlieren. Wenn Sie die IP-Adresse des Gateways geändert haben, müssen Sie die IP-Adresse in Ihrem Browser vor dem Zugriff auf die Konfigurationsoberfläche erneut ändern.",IT:"Questa configurazione potrebbe causare una perdita temporanea della connessione al gateway. Se si cambia l'indirizzo IP del gateway, allora si dovrà cambiare anche l'indirizzo nel browser prima di poter accedere nuovamente all'interfaccia di configurazione.",DA:"Den handling, som du har udført, kan gøre, at enhederne midlertidigt mister forbindelsen. Hvis du har ændret gatewayens IP-adresse, skal du ændre IP-adressen i din browser, før du går ind på konfigurationsbrugerfladen igen.",AR:"الإجراء الذي قمت به قد يتسبب في فقدان أجهزتك للإتصال بشكل مؤقت. إذا قمت بتغيير عنوان IP الخاص بالبوابة سوف تحتاج إلى تغيير عنوان IP في المتصفح الخاص بك قبل الدخول إلى واجهة التكوين مرة أخرى",PT:"A acçao pode causar a perda temporaria de conectividade. se voce alterou o endereço de IP do seu gateway, vai ter que alterar o endereço de IP do seu browser antes de aceder ao interface de configuraçao novamente.",RO:"TODO",IND:"TODO"},applyDNSChangesDescription:{EN:"Note that changing the DNS address will make the parental control ineffective",FR:"Le changement d'adresse DNS rendra le contrôle parental inopérant",SPN:"Considere que cambiar los DNS hara que el control parental no sea efectivo",DE:"Bitte beachten Sie, dass durch eine Änderung der DNS-Adresse die Kindersicherung nicht mehr funktioniert.",IT:"Il cambio di indirizzo di DNS rende il controllo parentale non più valido",DA:"Bemærk at en ændring af DNS IP adresse vil deaktivere Forældrekontrol. Forældrekontrol skal opsættes igen.",AR:"TODO",PT:"TODO",RO:"Nota: Schimbarea adresei DNS va genera dezactivarea controlului parental",IND:"TODO"},reconnectInstructionsDHCP:{EN:"The action you performed will cause devices to temporarily lose connectivity. To recover the conectivity with the gateway, you will have to change the IP address in your browser before accessing the configuration interface again.",FR:"TODO",SPN:"La accion realizada causara una perdidad de conexion temporal en los dispositivos. Para recuperar la conectividad con el gateway",DE:"Diese Aktion bewirkt, dass die Verbindung zu allen angeschlossenen Geräten kurz beendet werden muss. Um die Verbindung zu dieser Benutzeroberfläche wieder herzustellen, müssen Sie die IP-Adresse in Ihrem Browser entsprechend Ihrer Eingaben ändern.",IT:"TODO",DA:"Den ændring du har udført bevirker at dit udstyr mister forbindelsen til dit WiFiModem indtil udstyret har fået en ny IP adresse. For at tilgå WiFiModem websiden skal det nye IP scope netwærks adresse anvendes i adressefeltet i din internet browser.",AR:"TODO",PT:"TODO",RO:"Actiunea intreprinsa va cauza pierderea temporara a activitatii. Pentru a recupera conexiunea la retea trebuie sa schimbati adresa IP in aplicatia de internet inainte de a accesa din nou interfata de configurare.",IND:"TODO"},reconnectInstructions